import React from "react";
import './wallet.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCopy } from '@fortawesome/free-regular-svg-icons'; 

const Wallet = () => {
    return (
        <div className="wallet">
            <text className="heading">Wallet Address:</text> 
            <br></br>
            <div className="walletBox">
                <div className="walletBoxHeader">
                    <text className="subHeadingLeft">Wallet Address</text>
                    <FontAwesomeIcon className="subHeadingRight" icon={faCopy} /> 
                </div>
                <span className="walletAddressText">Here is your wallet address.</span> 
            </div>
            <button className="proceedBtn">Proceed</button>
        </div>
    );
};

export default Wallet;
